import React, { useState } from "react";
import "./Table.css";
import "../../../Css/VideoModal.css";
import "Functionality/ToolTip";
const VideoModal = ({ videoUrl, onClose }) => {
  return (
    <div className="video-modal">
      <div className="video-modal-content">
        <button className="close-button" onClick={onClose}>
          &times;
        </button>
        <iframe
          width="560"
          height="315"
          src={videoUrl}
          title="YouTube video player"
          frameBorder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
        ></iframe>
      </div>
    </div>
  );
};

const ChapterContent = ({ subTopicData }) => {
  const [videoUrl, setVideoUrl] = useState(null);
  const { title, levels } = subTopicData;

  const isYouTubeLink = (link) => {
    return link && (link.includes("youtube.com") || link.includes("youtu.be"));
  };

  const handleYouTubeClick = (link) => {
    const embedUrl = link.includes("youtube.com")
      ? link.replace("watch?v=", "embed/")
      : link.replace("youtu.be/", "www.youtube.com/embed/");
    setVideoUrl(embedUrl);
  };

  const closeModal = () => {
    setVideoUrl(null);
  };

  const truncateText = (text, maxLength) => {
    if (!text || text.length <= maxLength) return text;
    return text.substring(0, maxLength) + "...";
  };

  const renderCardContent = (item) => (
    <div key={item.id} className="card mb-3">
      <div className="card-body">
        <h3
          className="card-title"
          title={item.title || "No Title Available"} // Tooltip for title
          style={{
            whiteSpace: "nowrap",
            overflow: "hidden",
            textOverflow: "ellipsis",
          }}
        >
          {truncateText(item.title || "No Title Available", 20)}
        </h3>
        <p
          className="card-text"
          title={item.description || "No Description Available"} // Tooltip for description
          style={{
            whiteSpace: "nowrap",
            overflow: "hidden",
            textOverflow: "ellipsis",
          }}
        >
          <ToolTip description={item.description} />
          {/* {truncateText(item.description || "No Description Available", 30)} */}
        </p>
        <p>Rating: {"⭐".repeat(item.rating) || "N/A"}</p>
        {isYouTubeLink(item.link) ? (
          <img
            src="/image/youtube_logo.png"
            alt="YouTube"
            className="youtube-logo"
            onClick={() => handleYouTubeClick(item.link)}
          />
        ) : (
          item.link && (
            <div className="d-flex align-items-center">
              <img
                src="/image/link_logo.png"
                alt="Link"
                className="me-2"
                style={{ width: "24px", cursor: "pointer" }}
              />
              <a
                href={item.link}
                target="_blank"
                rel="noopener noreferrer"
                className="btn btn-primary btn-sm"
              >
                Visit Link
              </a>
            </div>
          )
        )}
        <p className="card-text">id: {item.id}</p>
      </div>
    </div>
  );

  return (
    <div className="containers">
      <div className="chapter">
        <div className="topic">
          <table className="table table-bordered">
            <thead className="table-dark">
              <tr>
                <th>Basic Level</th>
                <th>Intermediate Level</th>
                <th>Advanced Level</th>
                <th>Local NPTEL</th>
                <th>Live Video</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                {/* Basic Level */}
                <td>
                  {levels.basic && levels.basic.length > 0 ? (
                    levels.basic.map(renderCardContent)
                  ) : (
                    <p>No Basic Level Content Available</p>
                  )}
                </td>

                {/* Intermediate Level */}
                <td>
                  {levels.medium && levels.medium.length > 0 ? (
                    levels.medium.map(renderCardContent)
                  ) : (
                    <p>No Medium Level Content Available</p>
                  )}
                </td>

                {/* Advanced Level */}
                <td>
                  {levels.advanced && levels.advanced.length > 0 ? (
                    levels.advanced.map(renderCardContent)
                  ) : (
                    <p>No Advanced Level Content Available</p>
                  )}
                </td>

                {/* Local NPTEL */}
                <td></td>

                {/* Live Video */}
                <td></td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
      {videoUrl && <VideoModal videoUrl={videoUrl} onClose={closeModal} />}
    </div>
  );
};

export default ChapterContent;
